import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Main from './pages/main';
import './pages/home.css';
import APULogo from './assets/APULogo.png';
import { Button } from 'react-mdl';
import { Link, Route } from 'react-router-dom';

// Links to respective chat widget

const headerCont = {
  backgroundColor: "#990000",
  height: "60px",
  width: "100%",
}
const Logo = {
  marginLeft: "10px",
  marginTop: "5px",
  height: "50px"
}
const Name = {
  flex: 1,
  color: "#fff",
  marginTop: "10px",
  marginLeft: "30px"
}
const firstLinkStyle = {
  flex: 1,
  fontSize: "10",
  marginTop: "20px",
  color: "#fff",
  textAlign: "right"
}

class App extends React.Component {
  render() {
    return (
      <div>
        <div className="headerContainer" id="header" style={headerCont}>
          <img src={APULogo} style={Logo}/>
          <a href="/">
            <h1 style={Name}>Library Help Kiosk</h1>
          </a>
          <a href="/">
            <p style={firstLinkStyle}>APU Support Chat</p>
          </a>
        </div>
        <Main></Main>
      </div>
    );
  }
}

export default App;
